MOONEYES<p>
<font color="#dc143c" size="+2"><b>Hang Loose Tail Lamp Assembly for Motorcycle</b></font><br>
<font color="#ff0000" size="+1"><b>ハング ルーズ テール ランプ アッセンブリー モーターサイクル用</b></font></p>
<p>
ピースよりハワイな気分なサインであれば、この ハング ルーズ テール ランプ !<br>
下側にライセンス ランプ用のクリア レンズが付いた、モーターサイクル(バイク)用です。</p>
<p>
オール レッド レンズのオートモービル用もございます。</p><hr>
<p>
サイズ: (W) 16.5cm x (H) 10cm x (D) 6cm<br>
ベース: 約 (W) 8.5cm x (H) 10cm</p>
<p>クリアレジン製。<br>
12V(電球1つ付き)</p>
