用途：4ストロークエンジンオイル<br>
成分：特殊鉱物油<br>
<br>
オールドファッションマシーンの高温・高負荷条件下の長時間使用をコンセプトに開発された製品で、Moty's 独特の特殊鉱物油ならではのトルク感・静粛性をそのままに、その高レベルな熱安定性・耐久性に最大の特長があります。<br>
<br>
特殊鉱物油<br>
動粘度（40℃）　mm2/s 144<br>
動粘度（100℃）　mm2/s 16.9<br>
